import React from 'react';
import { Collapse } from 'react-bootstrap';

 const Workspace = ({exploreOpen}) => {
    var equalmark =  '=';  
    var plusmark =  '+';  
    var multimark =  '×';  


 return ( 
     <div>


       <Collapse in={exploreOpen}>

          
          <div>
              <input type="text"  value="" /> {equalmark} 
              <input type="text"  value="" /> {multimark} 
              <input type="text"  value="" /> {plusmark} 
              <input type="text"  value="" />
          </div>

      </Collapse>
     </div>
  )
};

export default Workspace;
